import React, { useEffect, useState } from "react";

export default function CoinCourse() {
  const [answer, setAnwser] = useState();

  const getAnswer = async () => {
    const res = await fetch("https://jsonplaceholder.typicode.com/todos?_limit=2");
    const answer = await res.json();
    setAnwser(answer);
  };

  useEffect(() => {
    getAnswer();
  }, []);

  const t = JSON.stringify(answer);
  return (<div>{t.map(answer => answer.title)}</div>);
  
//   return (<div>{JSON.stringify(answer)}</div>);
}
